from collections import Counter

def largest_k_multiple_free_subset_size(n, k, a):
    """"""
    a.sort()
    count = Counter(a)
    for num in a:
        if count[num] == 0:
            continue
        if count[num * k] > 0:
            count[num * k] -= 1
    return sum(count.values())
